INSERT INTO `T_OF_DS_SERVICE_CONFIG` VALUES ('getUserByKey', '-999', '02', '获取用户信息', '[{\"name\":\"KEY\",\"code\":\"`key`\",\"text\":\"密钥\",\"defaultValue\":\"\",\"type\":\"text\",\"mode\":\"eq\",\"required\":\"true\",\"width\":\"\",\"special\":\"\"}]', '[{\"name\":\"USER_ID\",\"text\":\"用户编号\"},{\"name\":\"USER_NAME\",\"text\":\"登陆账号\"},{\"name\":\"NICK_NAME\",\"text\":\"昵称\"},{\"name\":\"PHONE_NUMBER\",\"text\":\"手机号码\"},{\"name\":\"CLIENT_IP\",\"text\":\"授权IP\"},{\"name\":\"NEED_CHANGE_PASSWORD\",\"text\":\"是否需要修改密码\"},{\"name\":\"ALIVE_TIME\",\"text\":\"会话存活时长\"}]', '{\"sql\":\"SELECT k.`KEY`,u.USER_ID,u.USER_NAME,u.NICK_NAME,u.USER_PASSWD,u.ALIVE_TIME,u.CLIENT_IP,u.NEED_CHANGE_PASSWORD FROM T_OF_U_KEY k JOIN T_OF_SYS_USERS u ON (k.USER_ID=u.USER_ID) WHERE k.INVALID_TIME > NOW() and IS_VALID=\'1\' ${KEY}\"}', '1', null, null, '', null, '2018-05-10 18:25:52', '2018-05-16 01:13:11', '1', '1');
INSERT INTO `T_OF_DS_SERVICE_CONFIG` VALUES ('getUserConfigByKey', '-999', '02', '根据配置名获取用户配置值', '[{\"name\":\"key\",\"code\":\"`key`\",\"text\":\"用户授权码\",\"defaultValue\":\"\",\"type\":\"text\",\"required\":\"true\",\"mode\":\"eq\"},{\"name\":\"CONFIG_NAME\",\"text\":\"配置名\",\"defaultValue\":\"\",\"type\":\"text\",\"required\":\"true\",\"mode\":\"eq\"}]', '[{\"name\":\"CONFIG_VALUE\",\"text\":\"配置值\"}]', '{\"sql\":\"SELECT c.CONFIG_VALUE,c.CONFIG_NAME,`key` FROM T_U_CONFIG c JOIN T_OF_U_KEY k ON (c.USER_ID=k.USER_ID) where 1=1 ${key} ${CONFIG_NAME}\"}', '1', '0', '1', null, null, '2018-05-10 20:13:17', '2018-05-16 01:12:00', '1', '1');
