INSERT INTO `T_OF_DS_SERVICE_CONFIG` VALUES ('getValidUsers', '-999', '00', '获取所有有效用户', null, '[{\"name\":\"KEY\",\"text\":\"用户授权码\"},{\"name\":\"USER_PASSWD\",\"text\":\"用户密码\"},{\"name\":\"USER_ID\",\"text\":\"用户编号\"},{\"name\":\"USER_NAME\",\"text\":\"登陆账号\"},{\"name\":\"NICK_NAME\",\"text\":\"昵称\"},{\"name\":\"PHONE_NUMBER\",\"text\":\"手机号码\"},{\"name\":\"CLIENT_IP\",\"text\":\"授权IP\"},{\"name\":\"NEED_CHANGE_PASSWORD\",\"text\":\"是否需要修改密码\"},{\"name\":\"ALIVE_TIME\",\"text\":\"会话存活时长\"}]', '{\"sql\":\"SELECT k.`KEY`,u.USER_ID,u.USER_NAME,u.NICK_NAME,u.USER_PASSWD,u.ALIVE_TIME,u.CLIENT_IP,u.NEED_CHANGE_PASSWORD FROM T_OF_U_KEY k JOIN T_OF_SYS_USERS u ON (k.USER_ID=u.USER_ID) WHERE k.INVALID_TIME > NOW() and IS_VALID=\'1\'\"}', '1', '0', '1', null, null, '2018-05-10 20:13:17', '2018-05-16 01:18:30', '1', '1');
INSERT INTO `T_OF_DS_SERVICE_CONFIG` VALUES ('statPDDOrderByDay', '5', '02', '按日统计pdd利润', '[{\"name\":\"mallId\",\"code\":\"m.mallId\",\"text\":\"店铺编号\",\"defaultValue\":\"\",\"type\":\"list\",\"required\":\"true\",\"mode\":\"eq\"},{\"name\":\"confirmTime\",\"code\":\"o.CONFIRM_TIME\",\"text\":\"成交时间\",\"defaultValue\":\"\",\"type\":\"date\",\"required\":\"true\",\"mode\":\"range\"}]', '[{\"name\":\"date\",\"text\":\"日期\"},{\"name\":\"gain\",\"text\":\"利润\"},{\"name\":\"sales\",\"text\":\"销量\"},{\"name\":\"count\",\"text\":\"订单数\"}]', '{\"sql\":\"SELECT date,SUM(TOTAL_PRICE+SHIP_AMOUNT-TB_TOTAL_PRICE) \'gain\',SUM(QUANTITY) \'sales\',COUNT(1) \'count\' FROM (SELECT DATE_FORMAT(o.CONFIRM_TIME,\'%Y-%m-%d\') date,SRC_ORDER_ID,TB_TOTAL_PRICE,SUM(SHIP_AMOUNT) SHIP_AMOUNT,SUM(TOTAL_PRICE) TOTAL_PRICE,SUM(QUANTITY) QUANTITY FROM PDD_ORDER o  LEFT JOIN pdd_me m ON (o.GOODS_ID=m.goods_id) WHERE  IS_OWN=0 AND (o.IS_VALID=1 OR (o.IS_VALID=0 AND o.IS_SHIPED=2)) ${mallId} ${confirmTime} AND o.TB_TOTAL_PRICE <> 0 GROUP BY DATE_FORMAT(o.CONFIRM_TIME,\'%Y-%m-%d\'),SRC_ORDER_ID,TB_TOTAL_PRICE) a GROUP BY date ORDER BY date desc\"}', '1', '0', '1', null, null, '2018-05-16 09:30:12', '2018-05-16 02:33:43', '1', '1');
INSERT INTO `T_OF_DS_SERVICE_DIY` VALUES ('checkUserName', '[{\"name\":\"status\",\"text\":\"状态\",\"type\":\"text\",\"width\":\"40\",\"sortable\":\"\",\"hidden\":\"\",\"halign\":\"center\",\"align\":\"center\"}]', 'CLASS', 'com.ai.ctc.ods.of.ds.rest.service.CodeCheckUserName', null, '2017-05-20 11:01:38', '2017-03-17 01:50:45', '1');
INSERT INTO `T_OF_DS_SERVICE_DIY` VALUES ('checkUserName1', '[{\"name\":\"status\",\"text\":\"状态\",\"type\":\"text\",\"width\":\"40\",\"sortable\":\"\",\"hidden\":\"\",\"halign\":\"center\",\"align\":\"center\"}]', 'CODE', 'int status = 0;\r\nif (getUserInfo.size() == 1) {\r\n    // 临时需求：电话号码、姓名完全一致为：1（全匹配），电话号码一致，姓名不一不致：2（不匹配），查询结果为空：0（本号码不存在）\r\n    Object row = getUserInfo.get(0);\r\n    if (row instanceof Map) {\r\n        \r\n        Map data = (Map) row;\r\n        String name = (String) data.get(\"cust_name\");\r\n        if (null != name) {\r\n            if (name.equals(queryParams.get(\"name\"))) {\r\n                // 完全匹配\r\n                status = 1;\r\n            } else {\r\n                // 不匹配\r\n                status = 2;\r\n            }\r\n        }\r\n    }\r\n}\r\nMap<String, Integer> ret = new HashMap<String, Integer>();\r\nret.put(\"status\", status);\r\nreturn ret;', null, '2017-05-20 11:01:35', '2017-03-17 01:50:45', '0');
